import './styles/App.css';
import Nav from './components/Nav.js'
import About from './components/About.js'
import Projects from './components/Projects.js'

function App(props) {
  return (
    <div className="app">
      <Nav id="contact"/>
      <Projects id="project"/>
        <About id="about"/>

    </div>
  );
}

export default App;
